import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 23.1-713 Liberal construction of chapter.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-713.md","filePath":"vacode/23.1-713.md"}'),o={name:"vacode/23.1-713.md"},i=a('<h1 id="§-23-1-713-liberal-construction-of-chapter" tabindex="-1">§ 23.1-713 Liberal construction of chapter. <a class="header-anchor" href="#§-23-1-713-liberal-construction-of-chapter" aria-label="Permalink to &quot;§ 23.1-713 Liberal construction of chapter.&quot;">​</a></h1><p>Insofar as the provisions of this chapter are inconsistent with the provisions of any other general, special, or local law, the provisions of this chapter shall control. This chapter constitutes full and complete authority, without regard to the provisions of any other law, for performing the acts authorized in this chapter and shall be liberally construed to effect the purposes of this chapter.</p><p>2009, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0827" target="_blank" rel="noreferrer">827</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0845" target="_blank" rel="noreferrer">845</a>, § 23-38.87:1; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),n=[i];function c(s,l,h,p,f,_){return t(),r("div",null,n)}const g=e(o,[["render",c]]);export{u as __pageData,g as default};
